import React from 'react';
import { Link } from 'react-router-dom';

const App = () => {
  return (
    <div className="App">
      <nav>
        <ul>
          <li><Link to="/login">Login</Link></li>
          <li><Link to="/">Liste des locataires</Link></li>
          <li><Link to="/add-tenant">Ajouter un locataire</Link></li>
        </ul>
      </nav>
    </div>
  );
};

export default App;
